    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to
// be compatible with the behavior of Pandoc < 2.8).
document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

### Auswertung von Studien

####  DatensÃ¤tze kombinieren: Schritt 1 - Daten einlesen

* FÃ¼r den Fall, dass Ihre Studie nicht nur aus einem Survey in formr besteht, ist der erste Vorverarbeitungsschritt, dass Sie Ihre DatensÃ¤tze in einen einzelnen Datensatz kombinieren

* DafÃ¼r mÃ¼ssen Sie zunÃ¤chst alle DatensÃ¤tze einlesen: 


```r
survey1 &lt;- read.csv(&quot;../raw_data/survey1.csv&quot;)

```
usw.

class: top, left
### Auswertung von Studien

####  DatensÃ¤tze kombinieren: Schritt 2 - Leere sessions lÃ¶schen

* In jedem formr Survey gibt es die Spalte &quot;session&quot; die eindeutig eine Zeile im Datensatz einer DurchfÃ¼hrung des Fragebogen-Runs zuordnet

* Da jede Zeile eindeutig eine Person sein soll, kÃ¶nnen wir mit dieser Spalte also die DatensÃ¤tze richtig zusammenfÃ¼gen

* ZunÃ¤chst mÃ¼ssen wir dafÃ¼r aber alle Zeilen entfernen, in denen in &quot;session&quot; nichts drin steht (das ist i.d.R. der Fall, wenn der Fragebogensurvey nur geladen wurde, aber sonst nichts auf der Seite gemacht wurde):
  

```r
survey1 &lt;- survey1[survey1$session != &quot;&quot;,]
survey2 &lt;- survey2[survey2$session != &quot;&quot;,]
```
usw.

(R-Zeile 1 in Worten: Ãberschreibe das Objekt &quot;survey1&quot; mit den Zeilen vom Objekt &quot;survey1&quot; in denen in der Spalte &quot;session&quot; *nicht* &quot;&quot; (= nichts) drinsteht, und behalte alle Spalten)

---
class: top, left
### Auswertung von Studien

#### DatensÃ¤tze kombinieren: Schritt 3 - ZusammenfÃ¼gen

* FÃ¼r das ZusammenfÃ¼gen der Daten nutzen wir den Befehl `merge()`. Der Befehl muss wissen, welche Spalte er heranziehen soll, um die verschiedenen DatensÃ¤tze richtig in einen einzelnen Datensatz zusammenzufÃ¼gen, das ist in unserem Fall die Spalte &quot;session&quot;

* FÃ¼r weitere Spalten, die es in jedem Survey gibt (z.B. `created` = der Zeitpunkt zu dem das Survey begonnen wurde, oder `ended` = der Zeitpunkt zu dem das Survey abgeschickt wurde), kann man &quot;suffixes&quot; festlegen, das sind Zeichen, die an die Spaltennamen drangehÃ¤ngt werden, um sie eindeutig einem Survey zuzuordnen 

* FÃ¼r die Suffixes bietet sich der Name der surveys an, wobei der erste survey-Name erst im letzten merge angegeben werden sollte, damit alle Spalten am Ende eindeutig benannt sind:


```r
data &lt;- merge(survey1, survey2, by = &quot;session&quot;, suffixes = c(&quot;&quot;, &quot;_survey2&quot;), all = TRUE)
data &lt;- merge(data, survey3, by = &quot;session&quot;, suffixes = c(&quot;&quot;, &quot;_survey3&quot;), all = TRUE)
data &lt;- merge(data, survey4, by = &quot;session&quot;, suffixes = c(&quot;_survey1&quot;, &quot;_survey4&quot;), all = TRUE)
# Geschafft! Alle surveys befinden sich jetzt im Objekt `data`
```

* das Argument `all = TRUE` legt fest, dass alle Zeilen behalten werden sollen, auch wenn es in zwei Surveys keine zusammenpassenden session-IDs gibt. Das ist vor allem fÃ¼r die Studien relevant, in denen es unterschiedliche Bedingungen gab, aber ist auch sonst relevant (z.B. weil der Fragebogen abgebrochen wurde)

class: top, left
### Auswertung von Studien

#### Bedingungsvariable berechnen

* Wir Ã¼berschreiben die leeren Werte dieser Variable nun mit einer `ifelse()`-Funktion, welche 3 Argumente braucht:
  * erstes Argument der Funktion ist eine Bedingung (&quot;if&quot; also &quot;wenn&quot;), zu der ein Befehl ausgefÃ¼hrt werden soll. In unserem Fall wollen wir einen Wert einfÃ¼gen, &quot;wenn die entsprechende `ended`-Spalte nicht leer ist&quot;, d.h. in R-Code &quot;nicht leer&quot; = `!is.na()`
  * zweites Argument der Funktion ist der Befehl, der ausgefÃ¼hrt werden soll, wenn die &quot;if&quot;-Bedingung erfÃ¼llt ist. In unserem Fall wollen wir eine bestimmte Zahl vergeben, wenn jemand in der entsprechenden Bedingung war, z.B. `1`
  * drittes Argument der Funktion ist der Befehl, der ausgefÃ¼hrt werden soll, wenn die &quot;if&quot;-Bedingung *nicht* erfÃ¼llt ist (&quot;else&quot; also &quot;sonst&quot;). In unserem Fall wollen wir den Wert behalten, der bereits drin stand.
  

```r
data$condition &lt;- ifelse(!is.na(data$ended_condition1), 1, data$condition)
data$condition &lt;- ifelse(!is.na(data$ended_condition2), 2, data$condition)
data$condition &lt;- ifelse(!is.na(data$ended_condition3), 3, data$condition)
```

* Der Befehl in Worten: &quot;Wenn in einer Zeile des Datensatzes die `ended`-Spalte des Surveys von Bedingung 1 nicht leer ist, dann schreibe bitte in die Variable `condition` den Wert 1 rein, und sonst (wenn sie leer ist) behalte den Wert der vorher drin stand.&quot;

<script>var slideshow = remark.create({
"slideNumberFormat": "%current%",
"highlightStyle": "github",
"highlightLines": true,
"countIncrementalSlides": false,
"ratio": "16:9"
});
if (window.HTMLWidgets) slideshow.on('afterShowSlide', function (slide) {
  window.dispatchEvent(new Event('resize'));
});
(function(d) {
  var s = d.createElement("style"), r = d.querySelector(".remark-slide-scaler");
  if (!r) return;
  s.type = "text/css"; s.innerHTML = "@page {size: " + r.style.width + " " + r.style.height +"; }";
  d.head.appendChild(s);
})(document);

(function(d) {
  var el = d.getElementsByClassName("remark-slides-area");
  if (!el) return;
  var slide, slides = slideshow.getSlides(), els = el[0].children;
  for (var i = 1; i < slides.length; i++) {
    slide = slides[i];
    if (slide.properties.continued === "true" || slide.properties.count === "false") {
      els[i - 1].className += ' has-continuation';
    }
  }
  var s = d.createElement("style");
  s.type = "text/css"; s.innerHTML = "@media print { .has-continuation { display: none; } }";
  d.head.appendChild(s);
})(document);
// delete the temporary CSS (for displaying all slides initially) when the user
// starts to view slides
(function() {
  var deleted = false;
  slideshow.on('beforeShowSlide', function(slide) {
    if (deleted) return;
    var sheets = document.styleSheets, node;
    for (var i = 0; i < sheets.length; i++) {
      node = sheets[i].ownerNode;
      if (node.dataset["target"] !== "print-only") continue;
      node.parentNode.removeChild(node);
    }
    deleted = true;
  });
})();
// add `data-at-shortcutkeys` attribute to <body> to resolve conflicts with JAWS
// screen reader (see PR #262)
(function(d) {
  let res = {};
  d.querySelectorAll('.remark-help-content table tr').forEach(tr => {
    const t = tr.querySelector('td:nth-child(2)').innerText;
    tr.querySelectorAll('td:first-child .key').forEach(key => {
      const k = key.innerText;
      if (/^[a-z]$/.test(k)) res[k] = t;  // must be a single letter (key)
    });
  });
  d.body.setAttribute('data-at-shortcutkeys', JSON.stringify(res));
})(document);
(function() {
  "use strict"
  // Replace <script> tags in slides area to make them executable
  var scripts = document.querySelectorAll(
    '.remark-slides-area .remark-slide-container script'
  );
  if (!scripts.length) return;
  for (var i = 0; i < scripts.length; i++) {
    var s = document.createElement('script');
    var code = document.createTextNode(scripts[i].textContent);
    s.appendChild(code);
    var scriptAttrs = scripts[i].attributes;
    for (var j = 0; j < scriptAttrs.length; j++) {
      s.setAttribute(scriptAttrs[j].name, scriptAttrs[j].value);
    }
    scripts[i].parentElement.replaceChild(s, scripts[i]);
  }
})();
(function() {
  var links = document.getElementsByTagName('a');
  for (var i = 0; i < links.length; i++) {
    if (/^(https?:)?\/\//.test(links[i].getAttribute('href'))) {
      links[i].target = '_blank';
    }
  }
})();
// adds .remark-code-has-line-highlighted class to <pre> parent elements
// of code chunks containing highlighted lines with class .remark-code-line-highlighted
(function(d) {
  const hlines = d.querySelectorAll('.remark-code-line-highlighted');
  const preParents = [];
  const findPreParent = function(line, p = 0) {
    if (p > 1) return null; // traverse up no further than grandparent
    const el = line.parentElement;
    return el.tagName === "PRE" ? el : findPreParent(el, ++p);
  };

  for (let line of hlines) {
    let pre = findPreParent(line);
    if (pre && !preParents.includes(pre)) preParents.push(pre);
  }
  preParents.forEach(p => p.classList.add("remark-code-has-line-highlighted"));
})(document);</script>

  for (i = 0; i < els.length; i++) {

  }
